import React, { Component } from "react";
import logo from "../untied_logo.png";
import { taxYear_2019to2020, taxYear_2020to2021 } from "../reusableCalculator";

class TaxCalculator extends Component {
  state = {};

  taxYearSelect = (calculate) => {
    this.setState({ calculate });
  };

  whatToCalculateSelect = (value) => {
    this.setState({});
  };

  render() {
    console.log(this.state);
    return (
      <React.Fragment>
        <div className="logoDiv">
          <img src={logo} className="logo" />
        </div>
        <div className="mainDiv">
          <h1>Welcome to the Untied tax calculator</h1>

          <h3>First, select which tax year you want</h3>
          <div
            style={{
              width: "75%",
              margin: "auto",
              //   display: "flex",
              //   justifyContent: "space-around",
            }}
          >
            <span
              style={{ marginRight: "5%" }}
              onChange={() => this.taxYearSelect("2019/2020")}
            >
              <input type="radio" id="male" name="gender" value="male" />
              <label for="male">2019/2020</label>
            </span>

            <span
              style={{ marginLeft: "5%" }}
              onChange={() => this.taxYearSelect("2020/2021")}
            >
              <input type="radio" id="female" name="gender" value="female" />
              <label for="female">2020/2021</label>
            </span>
          </div>
          <h3>Now select what you would like to calculate</h3>
          <div
            style={{
              width: "75%",
              margin: "auto",
              //   display: "flex",
              //   justifyContent: "space-around",
            }}
          >
            <select id="cars" name="cars" style={{ width: "50%" }}>
              <option value="volvo"></option>
              <option
                value="volvo"
                onSelect={this.setState({ calculate: "takeHome" })}
              >
                Take-home pay from salary
              </option>
              <option
                value="saab"
                onSelect={this.setState({ calculate: "salary" })}
              >
                Salary from take-home pay
              </option>
            </select>
          </div>
          <label for="salary">{}</label>
          <input id="salary"></input>
        </div>
      </React.Fragment>
    );
  }
}

export default TaxCalculator;
